function ({ url: endpoint, headers: requestHeaders, params: queryParams, data: body }, { data: response }) {
    const config: AxiosRequestConfig = { headers: requestHeaders, params: queryParams };
    return axios.post(endpoint, body, config).then((res) => response.next(res.data));
}
